import java.io.*;import java.util.*;class Recycle {	public static void main(String [] args) throws Exception{		BufferedReader in = new BufferedReader(new InputStreamReader(System.in));		int T = Integer.parseInt(in.readLine());		for(int i = 0; i < T; i++){			int ans = 0;			StringTokenizer st = new StringTokenizer(in.readLine());			int A = Integer.parseInt(st.nextToken());			int B = Integer.parseInt(st.nextToken());			for(int j = A; j <= B; j++){				String s = "" + j;				HashMap<Integer,Integer> hm = new HashMap<Integer,Integer>();				for(int k = 0; k < s.length(); k++){					String rot = s.substring(k,s.length()) + s.substring(0,k);					hm.put(Integer.parseInt(rot),0);				}				for(int k : hm.keySet()){					if(j<k&&k<=B)						ans++;				}			}			System.out.println("Case #"+(i+1)+": " + ans);		}	}}